import React from "react";
import "./componentsCSS/Footer.css";

const Footer = () => {
	return (
		<div className="footerContainer">
			<div className="footerLinks">
				<a href="https://github.com/tjackreece">Github</a>
				<a href="https://twitter.com/jackreece_t">Twitter</a>
				<a href="https://www.linkedin.com/in/timothy-jackreece/">Linkedin</a>
			</div>
		</div>
	);
};

export default Footer;
